        self.queue = []
        self.distances = {}
        self.visited = set()

    def distance(self, node: Node) -> int:
        return self.distances.setdefault(node, -1)

    @require(lambda start: start.direction == Direction.OUTGOING)
    def search(self, start: Node) -> int:
        self.queue.append(start)
        while self.queue:
            current = self.queue.pop(0)
            self.visited.add(current)
            self.distances[current] = self.distance(current)

            for edge in self.graph.edges:
