        """
        for x in self.m:
            if x[0] == trick:
                return x[1]
        return None

    def probability_to_succeed(self, trick: int) -> Optional[float]:
        """
        If the trick succeeds, return the probability of success.
        """
        for x in self.m:
            if x[0] == trick:
                return x[1]
        return None

    def tricks_left_to_try(self, time: int) -> int:
        """
