"""
Solution Explanation

https://leetcode.com/problems/cell-with-the-greatest-number-of-alive-neighbors/discuss/1491816/C%2B%2BJavaPython-BFS-solution-O(mn)

Imagine a board of 0s and 1s. A 0 means the cell is dead, and a 1 means it is alive. We'll call a group of cells alive if they all have a 1.

So, the question is, what is the largest group of alive cells?

To do this, we'll do a breadth-first search. At every step, we'll check the 8 cells surrounding the current cell. If it's alive, add it to the current group. If it's dead, we'll see if the 8 surrounding cells are all alive. If they're not, then we'll reset the group and add the current cell to it.

When the group has a size of 1 (or the cell itself, for the first group), we know that's the largest group.
"""

import collections

class Solution:
    def solution(self, stdin: str) -> str:
        pass

    def bfs(self, x, y, z, grid):
        dx = [-1, 1, 0, 0, 0, 0, 0, 0]
        dy = [0, 0, -1, 1, 0, 0, 0, 0]
        dz = [0, 0, 0, 0, -1, 1, 0, 0]

        q = collections.deque()
        q.append((x, y, z))
        visited = set()

        while q:
            x, y, z = q.popleft()
            visited.add((x, y, z))
            for i in range(8):
                nx, ny, nz = x + dx[i], y + dy[i], z + dz[i]
                if (nx, ny, nz) not in visited and (0 <= nx < len(grid) and 0 <= ny < len(grid[0]) and 0 <= nz < len(grid[0][0])) and grid[nx][ny][nz] == 1:
                    grid[nx][ny][nz] = 0
                    q.append((nx, ny, nz))

    def solution(self, stdin: str) -> str:
        grid = []
        for _ in range(int(stdin)):
            grid.append([[1 if c == '1' else 0 for c in s] for s in stdin.split()])

        for x in range(len(grid)):
            for y in range(len(grid[0])):
                for z in range(len(grid[0][0])):
                    if grid[x][y][z] == 1:
                        self.bfs(x, y, z, grid)

        ans = 0
        for i in range(len(grid)):
            for j in range(len(grid[0])):
                ans = max(ans, sum(grid[i][j]))

        return ans

