        for line in lines[self.n + 1:]:
            od = line.split()[1:]
            for pair in od:
                a, b = pair.split(',')
                a, b = int(a), int(b)
                self.connections.add((a, b))

    def compute_flight_time(self):
        for i in range(self.n):
            for j in range(self.n):
                if i!= j:
                    self.flight_time[i, j] = self.airports[i].ds[j]

    def compute_flight_time_if_possible(self, s, t):
        if s == t:
            return 0

        if s > t:
            return -float('inf')

        return self.flight_time[s, t]

    def compute_min_flight_plan(self):
        queue = self.queue
        self.queue = []

        while queue:
            s, t, time = queue.pop(0)
            time += self.compute_flight_time_if_possible(s, t)

            if s > 0:
                queue.append((s - 1, t, time))

            if t < self.n - 1:
                queue.append((s, t + 1, time))

