----------Solution----------
The basic idea of this problem is that we have a ball in the first and second counters, and we have to find the number of customers who will be served in each of the two counters. So we can optimize the space complexity to O(1) and the time complexity to O(n) by using the observation that once we know the number of customers served in the first counter, we can calculate the number of customers served in the second counter.

Each customer has a duration time t_j, we want to find the total number of customers in the first and second counters. We can assume that the two counters are closed for the same time t.

So our problem becomes:

Number of customers served in the first counter: i
Number of customers served in the second counter: j
Given i, we know that the total number of customers served in both counters should be i + j

i + j = n
i + j - n = 0
i = n - j

We can solve the above equation by using binary search to find the minimum i and j.

class Solution:
    def solve(self, stdin: str) -> str:
        def binary_search(n: int, s1: int, s2: int) -> int:
            if s1 * s2 >= n:
                return n

            if n < s1:
                return 0
            else:
                i = n // 2
                j = n - i
                while True:
                    if i + j == n:
                        return i
                    if i + j > n:
                        i -= 1
                    else:
                        j += 1
                        if i + j == n:
                            return i

        n, s1, s2 = [int(c) for c in stdin.split()]
        return str(binary_search(n, s1, s2))

