from typing import List
import copy

class Sudoku:
    def __init__(self, lines: List[List[str]]):
        self.lines = lines
        self.row_len = len(lines[0])
        self.col_len = len(lines)
        self.boxes = self.get_boxes()
        self.board = self.parse_board()

    def get_boxes(self):
        boxes = []
        for i in range(0, self.row_len, 3):
            for j in range(0, self.col_len, 3):
                boxes.append([])
                for k in range(3):
                    for m in range(3):
                        boxes[-1].append(self.lines[i+k][j+m])
        return boxes

    def parse_board(self):
        board = []
        for i in range(self.row_len):
            board.append([])
            for j in range(self.col_len):
                board[i].append(self.lines[i][j])
        return board

    def solve(self):
        self.solve_row()
        self.solve_col()
        self.solve_box()

        for i in range(self.row_len):
            for j in range(self.col_len):
                if self.board[i][j] == "":
                    for n in range(1, 10):
                        if self.is_valid(i, j, str(n)):
                            self.board[i][j] = str(n)
                            if self.solve():
                                return True
                            self.board[i][j] = ""
                    return False
        return True

    def solve_row(self):
        for row in self.board:
            row_set = set()
            for n in row:
                if n!= "":
                    row_set.add(n)
            for n in range(1, 10):
                if n not in row_set:
                    for i in range(self.row_len):
                        if self.board[i][row[i]] == "":
                            self.board[i][row[i]] = str(n)
                            if self.solve_row():
                                return True
                            self.board[i][row[i]] = ""
                    return False

    def solve_col(self):
        for i in range(self.row_len):
            col_set = set()
            for j in range(self.col_len):
                if self.board[i][j]!= "":
                    col_set.add(self.board[i][j])
            for n in range(1, 10):
                if n not in col_set:
                    for j in range(self.col_len):
                        if self.board[i][j] == "":
                            self.board[i][j] = str(n)
                            if self.solve_col():
                                return True
                            self.board[i][j] = ""
                    return False

    def solve_box(self):
        for i in range(self.row_len):
            for j in range(self.col_len):
                box = self.boxes[i//3*3 + j//3]
                box_set = set()
                for n in box:
                    if n!= "":
                        box_set.add(n)
                for n in range(1, 10):
                    if n not in box_set:
                        self.board[i][j] = str(n)
                        if self.solve_box():
                            return True
                        self.board[i][j] = ""
                return False

    def is_valid(self, i: int, j: int, n: str) -> bool:
        if n in self.board[i]:
            return False
        for m in range(self.col_len):
            if self.board[i][m] == n:
                return False
        for m in range(self.row_len):
            if self.board[m][j] == n:
                return False
        for m in range(3):
            for n in range(3):
                if self.board[i//3*3+m][j//3*3+n] == n:
                    return False
        return True

