class Solution:
    def __init__(self, input):
        self.lines = input.split('\n')
        self.time_shortcuts = {}
        self.time_rules = {}
        self.remaining_time = {}
        self.shortcut_items = {}
        self.rule_items = {}
        self.n = 0

    def get_shortcut(self, level):
        if level not in self.time_shortcuts:
            time = int(self.lines[level].split(' ')[1])
            self.time_shortcuts[level] = time
            self.shortcut_items[level] = 0
            self.remaining_time[level] = time
        return self.time_shortcuts[level]

    def get_rule(self, level):
        if level not in self.time_rules:
            time = int(self.lines[level].split(' ')[1])
            self.time_rules[level] = time
            self.rule_items[level] = 0
            self.remaining_time[level] = time
        return self.time_rules[level]

    def get_shortcut_item(self, level):
        if level not in self.shortcut_items:
            self.shortcut_items[level] = 0
        return self.shortcut_items[level]

    def get_rule_item(self, level):
        if level not in self.rule_items:
            self.rule_items[level] = 0
        return self.rule_items[level]

    def get_items(self):
        for i in range(1, self.n + 1):
            self.get_shortcut_item(i)
            self.get_rule_item(i)

    def get_shortcut_time(self):
        for i in range(1, self.n + 1):
            self.get_shortcut(i)

    def get_time(self):
        for i in range(1, self.n + 1):
            self.get_rule(i)

    def get_diff(self):
        for i in range(1, self.n + 1):
            self.get_rule(i)
            self.get_shortcut(i)

    def get_remaining_time(self):
        self.get_time()
        self.get_diff()

    def get_shortcut_dict(self):
        for i in range(1, self.n + 1):
            self.get_shortcut_item(i)
            self.get_rule_item(i)

    def get_time_dict(self):
        for i in range(1, self.n + 1):
            self.get_rule(i)
            self.get_shortcut_item(i)

    def get_diff_dict(self):
        for i in range(1, self.n + 1):
            self.get_rule(i)
            self.get_shortcut_item(i)
            self.get_rule_item(i)
            self.get_shortcut_item(i)

    def solution(self):
        self.n = int(self.lines[0])
        self.get_items()
        self.get_remaining_time()
        self.get_shortcut_dict()
        self.get_time_dict()
        self.get_diff_dict()
        return min(self.remaining_time.values())

