        self.source_from = [0]
        self.transfer_from = []
        for i in range(self.N):
            current = self.v[i]
            if current < self.target:
                self.source_from.append(current)
            else:
                self.transfer_from.append(current)

    def build_transfer_to_target(self):
        self.transfer_to_target = self.v[:]

    def build_empty_source(self):
