        self._rows = rows
        self._columns = columns
        self._cells = array([['.' for _ in range(self._columns)] for _ in range(self._rows)])
        self._cells[0, :] = '1'
        self._cells[-1, :] = '2'

    def __getitem__(self, idx):
        return self._cells[idx]

    def __setitem__(self, idx, item):
        self._cells[idx] = item

    def __len__(self):
        return self._rows

    def __str__(self):
        return '\n'.join(''.join(row) for row in self._cells)

    def __repr__(self):
        return str(self)

    def __eq__(self, other):
        return self._cells == other._cells

    def __hash__(self):
        return hash(self._cells)

    @property
    def cells(self):
        """Return the grid of cells."""
        return self._cells

