class Board:
    def __init__(self, rows, columns):
        self.rows = rows
        self.columns = columns
        self.size = rows * columns

    def is_valid(self, v):
        return 0 <= v <= self.size - 1

    def place(self, domino):
        if not self.is_valid(domino.v):
            return False
        if not self.is_valid(domino.h):
            return False
        return True

    def place_all(self, dominoes):
        placed = 0
        while placed < len(dominoes):
            if not self.place(dominoes[placed]):
                return False
            placed += 1
        return True

    def cover(self, dominoes):
        max_length = 0
        for domino in dominoes:
            if domino.v > max_length:
                max_length = domino.v
            if domino.h > max_length:
                max_length = domino.h
        return max_length * 2

class Dominoes:
    def __init__(self, stdin):
        self.rows = int(stdin.readline().strip())
        self.columns = int(stdin.readline().strip())
        self.dominoes = []

