from math import sqrt
from typing import List, Set, Tuple


class Solution:
    def solve(self, n: int, towers: List[Tuple[float, float]]) -> int:
        """
        :type n: int
        :type towers: List[Tuple[float, float]]
        :rtype: int
        """

        def distance(a: Tuple[float, float], b: Tuple[float, float]) -> float:
            return sqrt((b[0] - a[0]) ** 2 + (b[1] - a[1]) ** 2)

        # 1. build the graph
        graph = {i: set() for i in range(1, n + 1)}
        for i in range(1, n + 1):
            for j in range(i + 1, n + 1):
                if distance(towers[i - 1], towers[j - 1]) <= 1:
                    graph[i].add(j)
                    graph[j].add(i)

        # 2. find start and end node
        start, end = None, None
        for i, s in graph.items():
            if len(s) == 1:
                start, end = i, s.pop()

        # 3. BFS
