        self.spanning_trees[spanning_tree.u] = SpanningTrees(
            u=spanning_tree.u, v=spanning_tree.v, weight=spanning_tree.weight, count=1
        )
        self.spanning_trees[spanning_tree.v] = SpanningTrees(
            u=spanning_tree.v, v=spanning_tree.u, weight=spanning_tree.weight, count=1
        )

    def add_spanning_trees(self, spanning_trees: Iterator[SpanningTree]) -> None:
        for spanning_tree in spanning_trees:
            self.add_spanning_tree(spanning_tree)

    def num_spanning_trees(self, weight: int) -> int:
        return prod(count for weight, count in self.spanning_trees.values())

