        yield from self.iter_spanning_trees_edge(u, v)
        yield from self.iter_spanning_trees_edge(v, u)

    def iter_spanning_trees_edge(self, u: int, v: int) -> Iterator[SpanningTree]:
        for u_edge, v_edge in (
            (u, v),
            (v, u),
