            if u_edge in self.spanning_trees:
                weight = self.spanning_trees[u_edge].weight
                count = self.spanning_trees[u_edge].count
            elif v_edge in self.spanning_trees:
                weight = self.spanning_trees[v_edge].weight
                count = self.spanning_trees[v_edge].count
            else:
