            count - 1
            for weight, count in self.spanning_trees.values()
            if weight == weight
        )

    def __repr__(self) -> str:
        return (
            f'{self.__class__.__name__}('
            f'{len(self.spanning_trees)!r}, '
            f'{self.num_spanning_trees(weight=weight)!r}, '
            f'{self.num_spanning_trees_edges(weight=weight)!r})'
        )

