from math import inf

class Solution:
    def lcs_aux(self, str1, str2):
        #Find the longest common subsequence for str1 and str2
        #O(nm) time | O(nm) space
        memo = [[None for _ in range(len(str2)+1)] for _ in range(len(str1)+1)]
        for i in range(len(str1)+1):
            for j in range(len(str2)+1):
                if i == 0 or j == 0:
                    memo[i][j] = 0
                elif str1[i-1] == str2[j-1]:
                    memo[i][j] = 1 + memo[i-1][j-1]
                else:
                    memo[i][j] = max(memo[i-1][j], memo[i][j-1])
        return memo[len(str1)][len(str2)]

    def lcs(self, str1, str2):
        #O(nm) time | O(min(n, m)) space
        if len(str1) < len(str2):
            return self.lcs(str2, str1)

        #Start at the ends and go inward
        memo = [[None for _ in range(len(str1)+1)] for _ in range(len(str2)+1)]
        for i in range(len(str2)+1):
            for j in range(len(str1)+1):
                if i == 0 or j == 0:
                    memo[i][j] = 0
                elif str1[j-1] == str2[i-1]:
                    memo[i][j] = 1 + memo[i-1][j-1]
                else:
                    memo[i][j] = max(memo[i-1][j], memo[i][j-1])

        return memo[len(str2)][len(str1)]

    def lcs_tab(self, str1, str2):
        #O(nm) time | O(nm) space
        memo = [[None for _ in range(len(str2)+1)] for _ in range(len(str1)+1)]
        for i in range(len(str1)+1):
            for j in range(len(str2)+1):
                if i == 0 or j == 0:
                    memo[i][j] = 0
                elif str1[i-1] == str2[j-1]:
                    memo[i][j] = memo[i-1][j-1] + 1
                else:
                    memo[i][j] = max(memo[i-1][j], memo[i][j-1])
        return memo[len(str1)][len(str2)]

    def lcs_tab_opt(self, str1, str2):
        #O(min(m, n)) time | O(min(m, n)) space
        if len(str1) < len(str2):
            return self.lcs_tab(str2, str1)

        #Start at the ends and go inward
        memo = [0 for _ in range(len(str1)+1)]
        for i in range(len(str1)+1):
            for j in range(len(str2)+1):
                if i == 0 or j == 0:
                    continue
                elif str1[i-1] == str2[j-1]:
                    memo[i] = 1 + memo[i-1]
                else:
                    memo[i] = max(memo[i-1], memo[i])
        return memo[len(str1)]

